import './App.css';
import Card from './components/card/card';


function App() {
  const data = [];
  let getData = async ()  => {
    const request = await fetch("https://6075786f0baf7c0017fa64ce.mockapi.io/products");
    const cardData = await request.json();
    return cardData.map((item) => {
      return data.push(item);
    });
  }
  return (
    <div className="App">
      <Card cardInfo={data}/>
    </div>
  );
}

export default App;
